import SelectGov from 'component-library-gov/Select';

export default function Select() {
  return (
    <>
      <form action="">
        <div>
          {/* Base checkbox has default options */}
          <SelectGov mini style={{ margin: '20px' }} name="test" />
        </div>
        <div style={{ margin: '20px' }}>
          {/* Styled checkbox falls back to tiny style from default props unless prop defined */}
          <SelectGov mini style={{ margin: '20px' }} name="test" />
        </div>
      </form>
    </>
  );
}
